import styled from 'styled-components';
import { Layout } from 'antd';
const { Header, Content, Sider } = Layout;

export const Head = styled(Header)`
  padding: 10px; 
  background-color: white;
  font: 20px;
  display: flex;
  justify-content: center;
`;
